import React, { useState, useMemo } from 'react';
import Card from './Card';
import Modal from './Modal';
import './Gallery.css';

const Gallery = ({ galleryData = [] }) => {
  const [expandedRowIndex, setExpandedRowIndex] = useState(null);
  const [modalState, setModalState] = useState({ isOpen: false, rowIndex: null, cardIndex: null });

  // Transform the data into 3 rows with 2 columns each
  const rows = useMemo(() => {
    const result = [];
    const numRows = 3; // We want 3 rows

    for (let i = 0; i < numRows; i++) {
      const row = [];
      // Each row will have 2 columns (from galleryData[0] and galleryData[1])
      if (galleryData[0] && galleryData[0][i]) {
        row.push({ ...galleryData[0][i], colIndex: 0, rowIndex: i });
      }
      if (galleryData[1] && galleryData[1][i]) {
        row.push({ ...galleryData[1][i], colIndex: 1, rowIndex: i });
      }
      if (row.length > 0) {
        result.push(row);
      }
    }

    return result;
  }, [galleryData]);

  const handleRowClick = (rowIndex) => {
    setExpandedRowIndex((prevIndex) => (prevIndex === rowIndex ? null : rowIndex));
  };

  const handleCollapseRow = (e) => {
    e.stopPropagation();
    setExpandedRowIndex(null);
  };

  const handleCardClick = (e, rowIndex, cardIndex) => {
    if (expandedRowIndex === rowIndex) {
      e.stopPropagation();
      // Find the actual indices in the original galleryData
      const card = rows[rowIndex][cardIndex];
      setModalState({ 
        isOpen: true, 
        rowIndex: card.colIndex, 
        cardIndex: card.rowIndex 
      });
    }
  };

  const closeModal = () => {
    setModalState({ isOpen: false, rowIndex: null, cardIndex: null });
  };

  return (
    <>
      <style>{`
        /* Main Gallery Layout */
        .gallery-wrapper {
          width: 100%;
          max-width: 1200px;
          margin: 0 auto;
          padding: 40px 20px;
          background: #f4f4f7;
          box-sizing: border-box;
        }

        .gallery-grid {
          display: flex;
          flex-direction: column;
          gap: 40px;
          width: 100%;
        }

        .card-row {
          position: relative;
          width: 100%;
          display: flex;
          justify-content: center;
        }

        .card-row.is-expanded {
          grid-column: 1 / -1;
          width: 100%;
          margin: 20px 0;
        }

        .card-stack {
          position: relative;
          list-style-type: none;
          margin: 0;
          padding: 0;
          width: 260px;
          min-height: 400px;
          transition: all 0.5s ease-in-out;
          cursor: pointer;
        }

        .card-row.is-expanded .card-stack {
          display: flex;
          flex-wrap: wrap;
          gap: 25px;
          width: 100%;
          height: auto;
          cursor: default;
        }

        /* Card Styling */
        .card {
          position: absolute;
          top: 0;
          left: 0;
          width: 260px;
          aspect-ratio: 2 / 3;
          background: #fff;
          border-radius: 8px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
          overflow: hidden;
          transition: all 0.5s cubic-bezier(0.4, 0, 0.2, 1);
          cursor: pointer;
        }

        .card img {
          width: 100%;
          height: 100%;
          object-fit: cover;
          pointer-events: none;
        }

        /* Expanded Cards */
        .card-row.is-expanded .card {
          position: relative;
          z-index: 1;
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .card-row.is-expanded .card:hover {
          transform: translateY(-5%);
          z-index: 2;
          box-shadow: 0 12px 28px rgba(0, 0, 0, 0.2), 0 0 20px rgba(0, 123, 255, 0.4);
        }

        .card-overlay {
          position: absolute;
          bottom: 0;
          left: 0;
          right: 0;
          background: linear-gradient(to top, rgba(0,0,0,0.8), transparent);
          color: white;
          padding: 20px 15px 15px;
        }

        .card-overlay h3 {
          margin: 0;
          font-size: 1.2rem;
          text-shadow: 1px 1px 2px rgba(0,0,0,0.8);
        }

        /* Back Arrow */
        .back-arrow {
          position: absolute;
          top: 8px;
          left: 8px;
          z-index: 10;
          width: 32px;
          height: 32px;
          background: rgba(0, 0, 0, 0.5);
          color: white;
          border-radius: 50%;
          display: flex;
          align-items: center;
          justify-content: center;
          cursor: pointer;
          opacity: 0.8;
          transition: all 0.2s ease;
        }

        .back-arrow:hover {
          background: rgba(0, 0, 0, 0.8);
          opacity: 1;
          transform: scale(1.1);
        }

        .back-arrow svg {
          width: 24px;
          height: 24px;
        }

        /* Modal Styles */
        .modal-overlay {
          position: fixed;
          top: 0;
          left: 0;
          width: 100vw;
          height: 100vh;
          background: rgba(0, 0, 0, 0.85);
          display: flex;
          align-items: center;
          justify-content: center;
          z-index: 1000;
          backdrop-filter: blur(5px);
          padding: 20px;
        }

        .modal-content {
          background: #fff;
          color: #333;
          border-radius: 8px;
          overflow: hidden;
          max-width: 900px;
          width: 100%;
          max-height: 95vh;
          display: flex;
          flex-direction: column;
          box-shadow: 0 10px 40px rgba(0,0,0,0.5);
          position: relative;
        }

        .modal-header {
          position: relative;
          width: 100%;
          height: 60vh;
          flex-shrink: 0;
        }

        .modal-header img {
          width: 100%;
          height: 100%;
          object-fit: cover;
          display: block;
        }

        .modal-title-overlay {
          position: absolute;
          bottom: 0;
          left: 0;
          width: 100%;
          background: linear-gradient(to top, rgba(0,0,0,0.8), transparent);
          color: white;
          padding: 40px 25px 20px;
          box-sizing: border-box;
        }

        .modal-title-overlay h2 {
          margin: 0;
          font-size: 2.2rem;
          text-shadow: 1px 1px 3px rgba(0,0,0,0.7);
        }

        .modal-body {
          padding: 20px 25px;
          overflow-y: auto;
        }

        .modal-body p {
          font-size: 1.1rem;
          line-height: 1.6;
          margin-bottom: 2em;
        }

        .modal-body h3 {
          margin-top: 1.5em;
          margin-bottom: 1em;
          border-bottom: 1px solid #eee;
          padding-bottom: 0.5em;
          font-size: 1.4rem;
        }

        .modal-body ul {
          list-style-type: none;
          padding: 0;
        }

        .modal-body li {
          padding: 10px 0;
          display: flex;
          gap: 15px;
          border-bottom: 1px solid #f5f5f5;
        }

        .modal-body li strong {
          color: #007bff;
        }

        .modal-close-btn {
          position: absolute;
          top: 15px;
          right: 15px;
          background: rgba(0, 0, 0, 0.4);
          border: none;
          border-radius: 50%;
